import React, { useEffect, useState } from "react";
import axios from "axios";
import AdminNavbar from "../../components/AdminNavbar";
import Loader from "../../components/Loader";
import { useNavigate } from "react-router-dom";

const CourseList = () => {
  const [courses, setCourses] = useState([]);
  const [loading, setLoading] = useState(true);
  const [message, setMessage] = useState("");
  const navigate = useNavigate();

  // Fetch courses from backend
  const fetchCourses = async () => {
    try {
      const token = localStorage.getItem("adminToken");
      if (!token) {
        navigate("/admin/login");
        return;
      }

      const response = await axios.get("http://localhost:5000/admin/courses", {
        headers: { Authorization: `Bearer ${token}` },
      });

      setCourses(response.data.courses || []);
      setMessage("");
    } catch (error) {
      console.error(error);
      if (error.response?.status === 401) {
        navigate("/admin/login");
      } else {
        setMessage(error.response?.data?.message || "Failed to load courses.");
      }
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchCourses();
  }, []);

  // Delete course
  const handleDelete = async (id) => {
    if (!window.confirm("Are you sure you want to delete this course?")) return;

    try {
      const token = localStorage.getItem("adminToken");
      await axios.delete(`http://localhost:5000/admin/course/${id}`, {
        headers: { Authorization: `Bearer ${token}` },
      });

      setCourses(courses.filter((course) => course._id !== id));
      setMessage("Course deleted successfully!");
    } catch (error) {
      console.error(error);
      setMessage(error.response?.data?.message || "Failed to delete course.");
    }
  };

  return (
    <div>
      <AdminNavbar />
      <div className="container" style={{ marginTop: "50px" }}>
        <h2 className="text-2xl font-bold mb-4">Course List</h2>
        {message && <p className="mb-4 text-center text-red-600">{message}</p>}
        {loading ? (
          <Loader />
        ) : (
          <table className="table table-bordered">
            <thead>
              <tr>
                <th>Course Name</th>
                <th>Course Code</th>
                <th>Department</th>
                <th>Description</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {courses.length === 0 ? (
                <tr>
                  <td colSpan="5" style={{ textAlign: "center" }}>
                    No courses found.
                  </td>
                </tr>
              ) : (
                courses.map((course) => (
                  <tr key={course._id}>
                    <td>{course.courseName}</td>
                    <td>{course.courseCode}</td>
                    <td>{course.department}</td>
                    <td>{course.description}</td>
                    <td>
                      <button
                        className="btn btn-danger btn-sm"
                        onClick={() => handleDelete(course._id)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))
              )}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default CourseList;
